import React from "react";
import './SlideshowButton.css';

export default function SlideshowButton({page}){
    const home = "home";

    if ({page}.toString() === home){
        return (
            <a href="#topLeftLogo" className="homeButton">Order Space</a>
        )
    } else if ({page} === "services"){
        return (
            <a href="#topLeftLogo" className="servicesButton">Book Service</a>
        )
    } else {
        return <a href="#topLeftLogo" className="servicesButton">{page}</a>
    }

}
